INSERT INTO `food` VALUES ('152', '猪肝', '', '129.00', '大卡', '100.00', '克', '猪肝中铁含量极高，是最佳补铁食物，同时还富含维生素A及B2，营养非常丰富，适宜减肥期间食用,但肝脏可能含有一定毒素，不宜一次食用过多。', '2', 'mint', null, 'images/82f1f78f9eedf3b0d0ea031a9163f9cf.jpg', 'images/f718f3afb345a0917686f8afd6036bb3.jpg', 'images/ef84f4f1b253a423fa484f5a9ff5b1a2.jpg');
INSERT INTO `food` VALUES ('153', '牛肉(里脊)', '', '107.00', '大卡', '100.00', '克', '里脊肉通常是畜肉中热量最低的，减肥期间建议尽量选择里脊肉，减肥期间可适量食用。', '2', 'mint', null, 'images/c8f8a1a05a6bbf45d5cb2c637e60de57.jpg', 'images/61359fe30301acb36b9ece245ebf2cd6.jpg', 'images/275d1476752a84e01b4dc049ef8a6c31.jpg');
INSERT INTO `food` VALUES ('154', '鸭胸脯肉', '', '90.00', '大卡', '100.00', '克', '鸭胸脯肉是鸭身上热量较低的部位，是减肥期间蛋白质最佳来源之一，适宜作为减肥期间的肉类食物来源适量食用。', '2', 'mint', null, 'images/a12a633e739c95589bd8c06f422385a9.jpg', 'images/18426a5c62f7e77aadaf485dc7a1ca1d.jpg', 'images/79b12bbb2212783388c3e14fff9aae14.jpg');
