INSERT INTO `food` VALUES ('157', '荷包蛋（煮）', '', '164.00', '大卡', '100.00', '克', '煮荷包蛋可以很好的保留鸡蛋的营养价值，同时并没有使用油类，热量不会增加，比起煎荷包蛋，煮荷包蛋较适宜减肥期间食用，但也不宜过多。', '2', 'mint', null, 'images/3f557e449a28fa7dec64c8b1a2ac650f.jpg', 'images/634daec3a64a0eea9dda719908ab0c19.jpg', 'images/e6c0229733301a28c1d67fa00c82044f.jpg');
