INSERT INTO `food` VALUES ('304', '梨，又叫梨子、快果、玉乳、果宗、蜜父、雪梨...', '梨子、快果、玉乳、果宗、蜜父、雪梨、香水梨、青梨', '44.00', '大卡', '100.00', '克', '钾，水分和纤维含量都较高的一种水果，有利于缓解便秘，适宜减肥期间食用。', '4', 'mint', null, 'images/0ba6d906442077e3891cce0855065ef8.jpg', 'images/11c05ccc252b1bb1cdf0ff28b0547c44.jpg', 'images/cdf1919cc1a35833fd27c314c20e9ade.jpg');
