INSERT INTO `food` VALUES ('306', '猕猴桃，又叫毛桃、藤梨、苌楚、羊桃、毛梨、...', '毛桃、藤梨、苌楚、羊桃、毛梨、连楚、奇异果', '56.00', '大卡', '100.00', '克', '维生素C含量较丰富的水果，纤维含量也较高，适宜减肥期间食用。', '4', 'mint', null, 'images/3c7252564979834fca42ea13c54aa13d.jpg', 'images/ca68e7c7646a399b97e0732fd045b432.jpg', 'images/dd13c843db3ed85caddb271f8a749f45.jpg');
INSERT INTO `food` VALUES ('307', '南瓜，又叫麦瓜、番瓜、倭瓜、金瓜、伏瓜、饭...', '麦瓜、番瓜、倭瓜、金瓜、伏瓜、饭瓜、窝瓜、中国南瓜', '22.00', '大卡', '100.00', '克', '南瓜热量低，碳水化合物含量较低，我们感觉它甜，并非因为其糖分高，而是因为其果糖成分比蔗糖要甜，推荐在减肥期间食用。', '4', 'mint', null, 'images/88ce05e4e7b6d468745cdcbeb14d66c6.jpg', 'images/da89fbb8a4955902f4d7f8ac77a7f9a9.jpg', 'images/b6d2ea6192f3bdb455902b42cd480d64.jpg');
INSERT INTO `food` VALUES ('308', '胡萝卜（老），又叫黄萝卜、金笋、丁香萝卜、...', '黄萝卜、金笋、丁香萝卜、红芦菔、甘笋、黄根、卜香菜、药萝卜、赤珊瑚', '37.00', '大卡', '100.00', '克', '水分和纤维含量较高的蔬菜，由于携带方便，有时也被用来代替水果食用，推荐减肥期间食用。', '4', 'mint', null, 'images/5463ed5b7f05ce387226bd7c65d57f61.jpg', 'images/a4fd12052f41a93f057ce0154ca1fcab.jpg', 'images/732251b6266a1b3145622ec8b72a71e3.jpg');
INSERT INTO `food` VALUES ('309', '生菜(牛俐)', '', '15.00', '大卡', '100.00', '克', '生菜热量较低，减肥期间适宜食用，且生菜非常适合生食，这样维生素基本没有流失，推荐在减肥期间食用。', '4', 'mint', null, 'images/2d5bdcdec2f8dc6a8905b4676f2ae738.jpg', 'images/f423b6335d503ef83d0d99e9aaffe2d6.jpg', 'images/2fe80c03082a7cbbf6918025cee3fa44.jpg');
INSERT INTO `food` VALUES ('310', '橘子，又叫橘柑、柑橘、桔柑子', '橘柑、柑橘、桔柑子', '43.00', '大卡', '100.00', '克', '橘子的含水量较高，热量在水果中属于中下水平，其维生素C含量并非很高，远低于猕猴桃、无花果等水果，适宜减肥期间食用。', '4', 'mint', null, 'images/b434b5d36545e09219b87e811342a22b.jpg', 'images/e09345d3f9887a23062039fb13d58cb4.jpg', 'images/5fec5d4ab5321f4c7e84cae95ad8a2f8.jpg');
INSERT INTO `food` VALUES ('311', '木瓜，又叫乳瓜、木梨、文冠果', '乳瓜、木梨、文冠果', '27.00', '大卡', '100.00', '克', '木瓜是一种热量较低的水果，适宜减肥期间食用，但并无丰胸效果。', '4', 'mint', null, 'images/36473e2184428910fabaea27f41f26e3.jpg', 'images/11622a38dfba9a67be1bdfda0eb5fc25.jpg', 'images/3fe7c889adde760b857d600685996694.jpg');
INSERT INTO `food` VALUES ('312', '葡萄，又叫草龙珠、山葫芦、蒲桃、菩提子、', '草龙珠、山葫芦、蒲桃、菩提子、', '43.00', '大卡', '100.00', '克', '葡萄中碳水化合物含量约占1/10，并且主要是葡萄糖，可快速被人体吸收利用，减肥时如遇到低血糖可以进食葡萄，减肥期间可适量食用。', '4', 'mint', null, 'images/4ac02012cb763fd7fc22857fef8440f2.jpg', 'images/e79980d22b90d041c9015756419a87ce.jpg', 'images/0ba4ce396ceae50cce90752ba4cf2d38.jpg');
INSERT INTO `food` VALUES ('313', '樱桃番茄，又叫葡萄番茄、小西红柿、圣女果、小番茄', '葡萄番茄、小西红柿、圣女果、小番茄', '22.00', '大卡', '100.00', '克', '一种热量低、含水量极高的蔬菜，由于其便携性，也常被当作水果食用，推荐在减肥期间食用。', '4', 'mint', null, 'images/4a6451707289324cff2741b7edc2ce34.jpg', 'images/ea24ff5b817dd39671f255319b70b458.jpg', 'images/57540b12c2fda4b571991ac281d3568b.jpg');
