INSERT INTO `food` VALUES ('316', '菜花，又叫花菜、花椰菜、椰花菜、花甘蓝、洋...', '花菜、花椰菜、椰花菜、花甘蓝、洋花菜、球花甘蓝', '24.00', '大卡', '100.00', '克', '菜花是维生素C和维生素K的优质来源，而且热量较低，推荐在减肥期间食用。', '4', 'mint', null, 'images/b187e17aa0ce8f5e1befc18e968f5df7.jpg', 'images/870452356e3b015819d0c9376af2e5fc.jpg', 'images/63284c2164061a424f42b79bc5d576c2.jpg');
