INSERT INTO `food` VALUES ('319', '白萝卜，又叫莱菔、荠根、萝欠、芦菔、萝白、...', '莱菔、荠根、萝欠、芦菔、萝白、紫菘、秦菘、萝臼、紫花菜、菜头', '21.00', '大卡', '100.00', '克', '白萝卜可促进肠道蠕动，预防便秘，同时热量非常低，且饱腹感较强，推荐在减肥期间食用。', '4', 'mint', null, 'images/5cd28dff7300391d0c1b11bb7b87fbb6.jpg', 'images/883ec3ba1345e2b8996168754fa9ecc7.jpg', 'images/c1faeef60b88906482a11305583dd5fa.jpg');
