INSERT INTO `food` VALUES ('324', '西兰花，又叫绿菜花、西兰花菜', '绿菜花、西兰花菜', '33.00', '大卡', '100.00', '克', '西兰花中维生素A及胡萝卜素含量极为丰富，且热量较低，推荐在减肥期间食用。', '4', 'mint', null, 'images/2f8df30c660f57ef1a23b93283f64629.jpg', 'images/c56d0012f770ec851417afa92932803d.jpg', 'images/4acdfeb79d9f526c347ef30738232ca4.jpg');
