INSERT INTO `food` VALUES ('326', '绿豆芽，又叫巧芽、豆芽菜、如意菜、掐菜、银...', '巧芽、豆芽菜、如意菜、掐菜、银芽、银针、银苗、芽心', '18.00', '大卡', '100.00', '克', '水分含量很高、营养价值较低的一种蔬菜，热量很低，含少量纤维，推荐在减肥期间食用。', '4', 'mint', null, 'images/5ca70d662f8dd3de0b78065df76baa01.jpg', 'images/a93e94afe128ba84f679124f6e776cb1.jpg', 'images/c1f8e77f34a427012c3270b5d0e3adcb.jpg');
INSERT INTO `food` VALUES ('327', '香菇，又叫冬菇、香菌、爪菰、花菇、香蕈、香...', '冬菇、香菌、爪菰、花菇、香蕈、香菰、香信', '19.00', '大卡', '100.00', '克', '香菇氨基酸和纤维素含量丰富，新鲜香菇还含有一定量的维生素，单位热量也比较低，推荐减肥期间食用。', '4', 'mint', null, 'images/7c8dbd6454e6f36ef589cdcdbbc003a2.jpg', 'images/5f1a6afc7a102f613c3885d306fb5184.jpg', 'images/d5cf507b4ff7feb417bb5072522287a6.jpg');
INSERT INTO `food` VALUES ('328', '茄子，又叫落苏、茄瓜', '落苏、茄瓜', '21.00', '大卡', '100.00', '克', '茄子是为数不多的紫色蔬菜之一，在它的紫皮中含有丰富的维生素E和维生素P，热量低且营养丰富，推荐在减肥期间食用。', '4', 'mint', null, 'images/470e71b5c0e24dd8e80e9234ba1c88c1.jpg', 'images/c621666130a2ca24a51ff1abcdefe726.jpg', 'images/a203b2f96f3a6aa355ec980b04f68f43.jpg');
INSERT INTO `food` VALUES ('329', '哈密瓜，又叫甜瓜', '甜瓜', '34.00', '大卡', '100.00', '克', '一种热量较低、高水分的食品，减肥时适量食用', '4', 'mint', null, 'images/767819bcac99398e4d820f1d47b60adc.jpg', 'images/1ca3be5981ae065452d75d39f07d135e.jpg', 'images/dea1ea58f7122a3c3f772c74ac185375.jpg');
INSERT INTO `food` VALUES ('330', '甜瓜，又叫甘瓜、库洪（维吾尔语）', '甘瓜、库洪（维吾尔语）', '26.00', '大卡', '100.00', '克', '甜瓜虽甜，糖分含量并不高，适宜减肥期间食用。', '4', 'mint', null, 'images/097c606ad45476334d7def2b3347d45b.jpg', 'images/268bb2ddef45460ad713c6be728fe6ff.jpg', 'images/e8ad6b485fad9109cafdd528605dd674.jpg');
INSERT INTO `food` VALUES ('331', '李子，又叫布朗、麦李、脆李、金沙李、嘉庆子...', '布朗、麦李、脆李、金沙李、嘉庆子、李实、嘉应子', '36.00', '大卡', '100.00', '克', '李子中果酸较多，能促进消化，热量不高，适宜减肥期间食用，但不能一次大量食用。', '4', 'mint', null, 'images/4958d90a1584d444a225265faeaadd25.jpg', 'images/67aea1f8bf99d3b5c59193e78f6edf83.jpg', 'images/739a780b647d9e7401ead08ed0bbf0ae.jpg');
INSERT INTO `food` VALUES ('332', '海带(浸)，又叫江白菜，昆布', '江白菜，昆布', '16.00', '大卡', '100.00', '克', '浸润后的海带热量很低，水分和钙的含量较高，同时含较多钾，有利于消除水肿，推荐减肥期间食用。', '4', 'mint', null, 'images/7f680b3c71a4670309190fccb378432e.jpg', 'images/d3bd0b312edcfc6ed0d9ec252296840d.jpg', 'images/3d792164724f04cf0bde1bdeacdff8da.jpg');
