INSERT INTO `food` VALUES ('369', '冬枣', '', '105.00', '大卡', '100.00', '克', '冬枣在水果中属于碳水化合物含量高、热量高的品种，其叶酸含量较高，年轻女性可适量食用。', '4', 'mint', null, 'images/894f463c16c7bfe4a161e286f60636d1.jpg', 'images/afc40874d0eb262be53778e6a4915912.jpg', 'images/7bf4b859fb1f9c074ed64733a5f1e914.jpg');
